import React from "react";
import { TextField } from "@material-ui/core";

const NavBarSearch = () => {
  return (
    <>
      <form noValidate autoComplete="off">
        <TextField
          style={{ color: "red" }}
          id="standard-basic"
          label="Search"
        />
      </form>
    </>
  );
};

export default NavBarSearch;
